import { Container } from "react-bootstrap";
import Heading from "../layout/Heading";
import PostList from "./PostList";

export default function EditPage() {
	return (
		<Container>
			<div className="edit-container">
			<Heading size="1" content="Rediger" />
            <PostList/>
		</div>
		</Container>
	);
}
